import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import HomePage from "./pages/HomePage"; // Ensure the file name matches exactly
import SelectionPage from "./pages/SelectionPage";
import ManualScanPage from "./pages/ManualScanPage";
import AutomatedScanPage from "./pages/AutomatedScanPage";
import InspectionPage from "./pages/InspectionPage";


function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<HomePage />} />
        <Route path="/selection" element={<SelectionPage />} />
        <Route path="/manual-scan" element={<ManualScanPage />} />
        <Route path="/automated-scan" element={<AutomatedScanPage />} />
        <Route path="/inspectioin" element={<Inspectionpage />} />
        <Route path="/upload-images" element={<div>Upload Images Page (Coming Soon!)</div>} />

      </Routes>
    </Router>
  );
}

export default App;
